  width: 2.5em;
}

.fa-inverse {
  color: var(--fa-inverse, #fff);
}

.sr-only,
.fa-sr-only {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  white-space: nowrap;
  border-width: 0;
}

.sr-only-focusable:not(:focus),
.fa-sr-only-focusable:not(:focus) {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  white-space: nowrap;
  border-width: 0;
}

.svg-inline--fa .fa-primary {
  fill: var(--fa-primary-color, currentColor);
  opacity: var(--fa-primary-opacity, 1);
}

.svg-inline--fa .fa-secondary {
  fill: var(--fa-secondary-color, currentColor);
  opacity: var(--fa-secondary-opacity, 0.4);
}

.svg-inline--fa.fa-swap-opacity .fa-primary {
  opacity: var(--fa-secondary-opacity, 0.4);
}

.svg-inline--fa.fa-swap-opacity .fa-secondary {
  opacity: var(--fa-primary-opacity, 1);
}

.svg-inline--fa mask .fa-primary,
.svg-inline--fa mask .fa-secondary {
  fill: black;
}

.fad.fa-inverse,
.fa-duotone.fa-inverse {
  color: var(--fa-inverse, #fff);
}

@tailwind base;
@tailwind components;
@tailwind utilities;
@tailwind variants;

@layer components {
  .card {
    background-color: theme('colors.dark-grey');
    border-radius: theme('borderRadius.lg');
    padding: theme('spacing.6');
    box-shadow: theme('boxShadow.xl');

    &.danger {
      background-color: rgba(255, 87, 103, 0.10);
      border: 1px solid theme('colors.red');
      color: white;
    }
  }

  .sliderInput {
    appearance: none;
    width: 100%;
    border-color: transparent;
    background-color: transparent;
    border-radius: 5px;
    outline: none;
    opacity: 0.7;
    transition: opacity .2s;
    cursor: pointer;
  }

  /***** Chrome, Safari, Opera, and Edge Chromium *****/
  input[type="range"].sliderInput::-webkit-slider-runnable-track {
    background: theme('colors.teal');
    height: 4px;
  }

  /******** Firefox ********/
  input[type="range"].sliderInput::-moz-range-track {
    background: theme('colors.teal');
    height: 4px;
  }

  input[type="range"].sliderInput::-webkit-slider-thumb {
    -webkit-appearance: none;
    /* Override default look */
    appearance: none;
    margin-top: -10px;
    /* Centers thumb on the track */
    background-color: theme('colors.teal');
    height: 1.5rem;
    width: 1.5rem;
    border-radius: 100%;
  }

    /******** Firefox ********/
    input[type="range"].sliderInput::-moz-range-thumb {
      outline: 3px solid theme('colors.teal');
      background-color: theme('colors.teal');
      outline-offset: 0.125rem;
    }
}

